import React from "react";
import "../Register/Register.css";
import { Link } from "react-router-dom";

const handleChange = async() => {

}
const handleSubmit = async() => {
    
}
const requestOtp = async () => {
    if (!values.email) {
      showAlert("Please enter email first", "error");
      return;
    }

    try {
      setLoading(true);
      await axios.post("http://localhost:3001/api/send-otp", {
        email: values.email,
      });

      showAlert("OTP sent successfully", "success");
      setOtpSent(true);
      setOtpExpired(false);
      setOtpVerified(false);
      setTimer(120);
    } catch (error) {
      showAlert(error.response?.data?.message || "Failed to send OTP", "error");
    } finally {
      setLoading(false);
    }
  };

  const verifyOtp = async () => {
    if (!values.otp) {
      showAlert("Please enter OTP", "error");
      return;
    }

    try {
      setLoading(true);
      await axios.post("http://localhost:3001/api/verify-otp", {
        email: values.email,
        otp: values.otp,
      });

      showAlert("OTP verified successfully", "success");
      setOtpVerified(true);
    } catch (error) {
      showAlert(error.response?.data?.message || "Invalid OTP", "error");
    } finally {
      setLoading(false);
    }
  };
const Password = () => {
  return (
    <div className="body">
      <div className="Register">
        <Link to="/Login" className="backBtn">
          Back
        </Link>

        <h1>Reset Password</h1>

        <form onSubmit={handleSubmit}>
          <div>
            <label>Email</label>
            <input
              type="email"
              name="email"
              placeholder="Enter Email"
              onChange={handleChange}
              required
            />
          </div>
          {otpSent && !otpVerified && (
              <div className="otp">
                <label>Enter OTP:</label>
                <input
                  type="text"
                  name="otp"
                  className="otpEnter"
                  onChange={handleChange}
                />
                <div className="verify">
                  <button type="button" onClick={verifyOtp}>
                    Verify
                  </button>
                </div>
              </div>
            )}
            {!otpVerified && otpSent && !otpExpired && timer > 0 && (
              <div className="otp-timer">
                Time Remaining: {Math.floor(timer / 60)}:
                {String(timer % 60).padStart(2, "0")}
              </div>
            )}

            {!otpVerified && (
              <button
                type="button"
                onClick={requestOtp}
                disabled={loading || (otpSent && !otpExpired)}
              >
                {otpSent ? "Resend OTP" : "Request OTP"}
              </button>
            )}
          <div>
            <label>Password</label>
            <input
              type="password"
              name="password"
              placeholder="Enter Password"
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>Re enter Password</label>
            <input
              type="password"
              name="password"
              placeholder="Enter Password"
              onChange={handleChange}
              required
            />
          </div>
          <div
            style={{
              textAlign: "right",
              fontSize: "15px",
              marginTop: "-5px",
              marginBottom: "2px",
            }}
          >
            <Link to="/resetPassword">Forgot password</Link>
          </div>
          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
};

export default Password;
